import React from 'react';
import Navbar from '../Navbar';
import Menu from '../Menu';
import Footer from '../Footer';

const Menuss = () => {
  return (
    <>
        <Navbar/>
        <Menu/>
        <Footer/>
    </>
  )
}

export default Menuss;
